        /// <summary>
        /// Creates a BigFloat array of common irrationals. 
        /// </summary>
        /// <param name="minimumAccuracy">The required number of bits to the right of the radix point that should be returned.
        /// Irrationals where the available precision is not met will not be included in the array. 
        /// Extra included numbers will be forced to this precision.</param>
        /// <param name="useExternalFiles">If True, will use external files for numbers larger than 5000 digits.</param>
        /// <param name="includedWholeNumbers">Whole numbers that should be included. Example: [0,1,2,3] </param>
        /// <returns>Returns an array of BigFloats that meet the accuracy requirements.</returns>
        public static BigFloat[] GenerateArrayOfCommonConstants(
            int minimumAccuracy = 2000,
            bool useExternalFiles = true,
            int[] includedWholeNumbers = null)
        {
            if (minimumAccuracy < 2)
            {
                throw new ArgumentOutOfRangeException(nameof(minimumAccuracy), "The minimum accuracy should be at least a few bits.");
            }

            List<BigFloat> bfList = [];

            // Add included numbers...
            if (includedWholeNumbers != null)
            {
                foreach (BigInteger c in includedWholeNumbers) // ??= new int[])
                {
                    int adjBitLen = minimumAccuracy - MantissaSize(c);
                    bfList.Add(new(c << adjBitLen, -adjBitLen));
                }
            }

            // Add common irrationals...
            ConstantInfo[] items = [
                Const_0_0307, Const_0_0458, Const_0_2078, Const_0_2205,
            Const_0_2614, Const_0_2692, Const_0_4132, Const_0_4146,
            Const_0_4282, Const_0_4382, Const_0_4533, Const_0_4812,
            Const_0_4980, Const_0_5215, Const_0_5393, Const_0_5495,
            Const_0_5614, Const_0_5671, Const_0_5675, Const_0_5772,
            Const_0_5990, Const_0_6248, Const_0_6366, Const_0_6601,
            Const_0_6738, Const_0_6859, Const_0_6932, Const_0_7064,
            Const_0_7071, Const_0_7104, Const_0_7861, Const_0_7875,
            Const_0_8379, Const_0_8652, Const_0_8744, Const_0_8803,
            Const_0_8984, Const_0_9036, Const_0_9117, Const_0_9159,
            Const_0_9235, Const_0_9238, Const_0_9261, Const_0_9330,
            Const_0_9343, Const_0_9497, Const_0_9510, Const_0_9659,
            Const_0_9749, Const_0_9807, Const_0_9848, Const_0_9876,
            Const_1_0750, Const_1_1447, Const_1_1739, Const_1_1755,
            Const_1_1875, Const_1_2020, Const_1_2055, Const_1_2720,
            Const_1_2824, Const_1_3002, Const_1_3035, Const_1_3247,
            Const_1_3392, Const_1_3584, Const_1_3748, Const_1_3802,
            Const_1_4142, Const_1_4396, Const_1_4432, Const_1_4446,
            Const_1_4603, Const_1_4655, Const_1_5015, Const_1_5170,
            Const_1_5236, Const_1_5341, Const_1_5452, Const_1_5690,
            Const_1_5701, Const_1_6180, Const_1_6487, Const_1_7320,
            Const_1_7523, Const_1_7724, Const_1_7810, Const_1_9187,
            Const_1_9416, Const_15_154, Const_2_2228, Const_2_3312,
            Const_2_3416, Const_2_5029, Const_2_6854, Const_2_7182,
            Const_22_459, Const_23_140, Const_262537, Const_3_1415,
            Const_3_3596, Const_3_6462, Const_3_6760, Const_4_4810,
            Const_4_6692, Const_7_3890, Const_8_5397, Const_9_8696
            ];

            foreach (ConstantInfo c in items)
            {
                AddConstantToList(bfList, c, minimumAccuracy, useExternalFiles);
            }

            bfList.Sort((x, y) => x.CompareTo(y));
            // Alternative method: bfList = bfList.OrderBy(i => i);

            return [.. bfList];
        }

        /// <summary>
        /// Adds the supplied irrational number to the supplied list if the minimum accuracy can be met.
        /// </summary>
        /// <param name="targetList">The BigFloat list to add to.</param>
        /// <param name="minimumAccuracy">The minimum accuracy in bits that must be available via the class or external file.</param>
        public static void AddConstantToList(ICollection<BigFloat> targetList, ConstantInfo constantToAdd, int minimumAccuracy, bool useExternalFiles = true)
        {
            ArgumentNullException.ThrowIfNull(targetList);

            bool success = constantToAdd.TryGetAsBigFloat(out BigFloat value, minimumAccuracy, useExternalFiles: useExternalFiles);
            if (success)
            {
                targetList.Add(value);
            }
        }

